import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';
import {Modal, ModalBody} from 'reactstrap';
import { connect } from 'react-redux';


class SignedIn extends Component {
  state={
    isModalOpen: false
  };

  toggleModal=()=> {
    this.setState({
      isModalOpen: !this.state.isModalOpen
    });
  }
 render(){
  return (
    <React.Fragment>
       <ul className="right">
           <li><NavLink   to="/"><i className="material-icons">collections</i></NavLink></li>
           <li><NavLink to="/"><i className="material-icons">add_a_photo</i></NavLink></li>
           <li><NavLink to="/" ><img style={{width:"40px",height:"40px",borderRadius:"40px",verticalAlign:"middle"}} src="https://avatars2.githubusercontent.com/u/51698550?s=460&u=b2a9911e8c6e6dc7f76328e3a3495a60a043b869&v=4"/></NavLink></li>
           <li><NavLink to="/login"><i onClick={()=>props.LOGOUT(props)} className="material-icons">power_settings_new</i></NavLink></li>  
       </ul> 
       <Modal isOpen={this.state.isModalOpen} toggle={this.toggleModal}>

       </Modal>
    </React.Fragment>   
   )
 }
}

const mapDispatchToProps=(dispatch)=>{
    return {
      LOGOUT:(props)=>{dispatch(LOGOUT(props))}
    }
  }

export default connect(null,mapDispatchToProps)(SignedIn);
